#{
$script:RegeditKeysList = @{}
$script:RegFileArrayCont = @{}
$ScriptDir = Split-Path $script:MyInvocation.MyCommand.Path

$IsArchX64 = $false
$PathToRegCPro = "HKEY_LOCAL_MACHINE\Software\Crypto Pro\Settings\Users"
#If((Get-WmiObject Win32_OperatingSystem).OSArchitecture.Equals("64-bit")) 
#If($ENV:PROCESSOR_ARCHITECTURE -eq "AMD64")
If([IntPtr]::Size -eq 8) 
{
	$IsArchX64 = $true
	$PathToRegCPro = "HKEY_LOCAL_MACHINE\Software\Wow6432Node\Crypto Pro\Settings\Users"
}

$SID = (Get-WmiObject win32_useraccount -Filter "Name='$($env:USERNAME)'").SID
If($SID.length -eq 0) {
	$SID = (Get-WmiObject win32_useraccount -Filter "Name='$($env:USERNAME)' AND domain = '$env:USERDOMAIN'").SID
} 
If($SID.length -eq 0) {
	$NtAccountObj = New-Object System.Security.Principal.NTAccount('$env:USERDOMAIN','$env:USERNAME')
	$SID = $($NtAccountObj.Translate([System.Security.Principal.SecurityIdentifier])).Value
}

$FullPathToReg = "$PathToRegCPro\$SID\Keys"
#}

#{ csptest.exe (base64)
$csptest=""
#}

Function MsgBox($x) {
    [System.Windows.Forms.MessageBox]::Show($x, 'Done!:PowerShell')
    #, 
	#[Windows.Forms.MessageBoxButtons]::OK, 
	#[Windows.Forms.MessageBoxIcon]::Information, [Windows.Forms.MessageBoxDefaultButton]::Button1,
	#[Windows.Forms.MessageBoxOptions]::ServiceNotification
    #)
}

Function UpdateListBoxFiles {
	$objListBoxFiles.Items.Clear()
	$ScriptDirExist = Test-Path -Path $ScriptDir
	If ($ScriptDirExist -eq $True) {
		(Get-ChildItem -Path "$ScriptDir\" -Filter *.reg) | % {
			[void]$objListBoxFiles.Items.Add($_.Name)
		}
	}
	$objForm.Refresh()
}

Function UpdateListBoxRegedit {
	$objListBoxRegedit.Items.Clear()
	$script:RegeditKeysList = @{}
	$FullPathToRegExist = Test-Path -Path Registry::$FullPathToReg
	If ($FullPathToRegExist -eq $True) {
		(Get-ChildItem -Path Registry::$FullPathToReg) | % {
			$Key = $_.Name.Substring($FullPathToReg.Length+1)
			$Value = $_.Name
			$script:RegeditKeysList.Add($Key,$Value)
			[void]$objListBoxRegedit.Items.Add($Key)
		}
	}
	$objForm.Refresh()
}

Function ExportCsptestUtility {
	$Base64StringDecode = [Convert]::FromBase64String($csptest)
	[IO.File]::WriteAllBytes("$ScriptDir\csptest.exe", $Base64StringDecode)
}

Function InstallAllCertificates {
	CMD /C "csptest -absorb -certs -pattern `"\\.\REGISTRY\`"" 
    #&& echo 1 || echo 0" | % {
	#		if ($_ -match '1')
	#		{ $ex++ }
	#		elseif ($_ -match '0')   
	#		{ $ex }
	#		else
	#		{ $ex }
	#	}
}

Function ChangeSIDUserAndOSPathInFile($RegFile) {
	$RegFileSource = "$ScriptDir\$RegFile"
    $RegFileSourceExists = Test-Path $RegFile
	If ($RegFileSourceExists -eq $True)
	{
		$TmpFile = "$ScriptDir\tmp.reg"
		$TmpFileExists = Test-Path $TmpFile
		If ($TmpFileExists) 
		{
			Remove-Item -Path $TmpFile -Force
		}
		$RegFileBackup = "$ScriptDir\$RegFile.backup"
		Copy-Item -Path $RegFileSource -Destination $RegFileBackup
		#Write-Host $RegFileBackup
		Copy-Item -Path $RegFileSource -Destination $TmpFile
		#$FindPatternSID = "Users\\(S-.*?)\\Keys"
		$FindPatternSID = "(S-\d-\d-\d+-\d+-\d+-\d+-\w+)"
		$FindPatternOSPath = "Software\\Wow6432Node\\Crypto Pro"
		$ReplacePatternOSPath = "Software\\Crypto Pro"
		If($IsArchX64) 
		{ 
			$FindPatternOSPath = "Software\\Crypto Pro"
			$ReplacePatternOSPath = "Software\\Wow6432Node\\Crypto Pro"
		}
		$script:RegFileArrayCont = @{}
		Get-Content $TmpFile | % {
			$Matches=@()
			$IsFindCont = $($_ -match "\d+\\Keys\\(\w.*)]$")
			If($IsFindCont){
				$script:RegFileArrayCont.Add($Matches[1],$Matches[1])#[System.Collections.ArrayList]
			}
			$_ -replace $FindPatternSID, $SID `
			   -replace $FindPatternOSPath, $ReplacePatternOSPath
		} | Set-Content $RegFileSource
		Remove-Item -Path $TmpFile -Force
	}
}

#$objForm = New-Object System.Windows.Forms.Form
$objForm.Text = "CryptoPRO import\export regedit keys utility"
$objForm.Size = New-Object System.Drawing.Size(900,550)
$objForm.StartPosition = "CenterScreen"

#$objListBoxRegedit = New-Object System.Windows.Forms.CheckedListBox
$objListBoxRegedit.Location = New-Object System.Drawing.Size(10,10)
$objListBoxRegedit.Size = New-Object System.Drawing.Size(400,400)
$objForm.Controls.Add($objListBoxRegedit)

#$objButtonExport = New-Object System.Windows.Forms.Button
$objButtonExport.Location = New-Object System.Drawing.Size(10,410)
$objButtonExport.Size = New-Object System.Drawing.Size(150,30)
$objButtonExport.BackColor ="Blue"
$objButtonExport.ForeColor ="White"
$objButtonExport.Text = "Export selected keys"
$objButtonExport.Add_Click({
	#$objForm.Close()
	$items = $objListBoxRegedit.CheckedItems
	$ex = 0;$sel = 0
	foreach ($item in $items)
	{ 
		$sel++
		$NameKey = $item.ToString()
		$RegPath = $script:RegeditKeysList[$item.ToString()]
		#Write-Host $NameKey
		#Write-Host $RegPath
		
		$DestPath = $("$ScriptDir\$NameKey.reg" -replace "[@ ]", "_")
		CMD /C "reg export `"$RegPath`" `"$DestPath`" /y && echo 1 || echo 0" | % {
			if ($_ -match '1')
			{ $ex++ }
			elseif ($_ -match '0')   
			{ $ex }
			else
			{ $ex }
		}
	}
	MsgBox("'Regedit' keys selected ($sel), exported ($ex).")
	UpdateListBoxFiles
})
$objForm.Controls.Add($objButtonExport)

$objAllKeysExportCheckbox.Location = New-Object System.Drawing.Size(10,450) 
$objAllKeysExportCheckbox.Size = New-Object System.Drawing.Size(200,20)
$objAllKeysExportCheckbox.Text = "Export all certificates?"
$objAllKeysExportCheckbox.TabIndex = 4
$objAllKeysExportCheckbox.Add_CheckStateChanged({
    0..($objListBoxRegedit.Items.Count-1) | % {
        $objListBoxRegedit.SetItemChecked($_, $objAllKeysExportCheckbox.Checked)
    }
})
$objForm.Controls.Add($objAllKeysExportCheckbox)


#$objListBoxFiles = New-Object System.Windows.Forms.CheckedListBox
$objListBoxFiles.Location = New-Object System.Drawing.Size(420,10)
$objListBoxFiles.Size = New-Object System.Drawing.Size(400,400)
$objForm.Controls.Add($objListBoxFiles)

#$objButtonImport = New-Object System.Windows.Forms.Button
$objButtonImport.Location = New-Object System.Drawing.Size(420,410)
$objButtonImport.Size = New-Object System.Drawing.Size(150,30)
$objButtonImport.BackColor ="Green"
$objButtonImport.ForeColor ="White"
$objButtonImport.Text = "Import selected keys"
$objButtonImport.Add_Click({
	#$objForm.Close()
	$items = $objListBoxFiles.CheckedItems
	$ex = 0;$sel = 0
	$installCertificates = $($objTypeCheckbox.Checked -eq $true)
	If ($installCertificates) { ExportCsptestUtility }	
	foreach ($item in $items)
	{
		$sel++
		$NameFile = $item.ToString()
		$SrcPath = "$ScriptDir\$NameFile"
		ChangeSIDUserAndOSPathInFile $NameFile
		CMD /C "reg import `"$SrcPath`" && echo 1 || echo 0" | % {
			if ($_ -match '1')    
			{ 
				$ex++ 
				#Install imported certificate, cont to store 'MY' with secret key linking
				If ($installCertificates) { 
					$script:RegFileArrayCont.Keys | % {
						CMD /C "csptest -property -cinstall -cont `"\\.\REGISTRY\$_`">nul 2>&1"
					}
				}
			}    
			elseif ($_ -match '0')   
			{ $ex }   
			else    
			{ $ex }
		}
	}
	MsgBox("'Regedit' keys selected ($sel), imported ($ex).")
	UpdateListBoxRegedit
})
$objForm.Controls.Add($objButtonImport)

